import logo from "../image/MARCELA YAMUR (1).png";
import Profile from "./Profile";

import "../stylesheets/style.css";

const App = () => {
  return (
    <body>
      <img className="logo-my" src={logo} />
      <Profile />
    </body>
  );
};

export default App;
